import React from 'react'
import ReactDOM from 'react-dom/client'
import './index.css'
import App from './App'

// Creating a root DOM element where the React app will be rendered
const root = ReactDOM.createRoot(document.getElementById('root'))

// Rendering the App component inside the root element, wrapped in React.StrictMode
root.render(
  <React.StrictMode> {/* StrictMode helps highlight potential problems in the app */}
    <App /> {/* Main component that contains the app's functionality */}
  </React.StrictMode>
)
